class Solution {
    func maxFrequencyElements(_ nums: [Int]) -> Int {
        var frequency = [Int: Int]() // Dictionary to store the frequency of each element

        // Counting the frequency of each element
        for num in nums {
            frequency[num, default: 0] += 1
        }

        // Finding the maximum frequency
        let maxFreq = frequency.values.max() ?? 0

        // Counting how many elements have the maximum frequency
        let countOfMaxFreqElements = frequency.values.filter { $0 == maxFreq }.count

        return countOfMaxFreqElements * maxFreq
    }
}
